 public CDOTransactionHandler[] getTransactionHandlers(){  Set<CDOTransactionHandler> result = new HashSet<CDOTransactionHandler>();  synchronized (transactionHandlersLock)     {  for (CDOTransactionHandler1 handler : transactionHandlers1.get())       {  if (handler instanceof CDOTransactionHandler)         {  result.add((CDOTransactionHandler)handler);         }       }  for (CDOTransactionHandler2 handler : transactionHandlers2.get())       {  if (handler instanceof CDOTransactionHandler)         {  result.add((CDOTransactionHandler)handler);         }       }     } } 
